import React from 'react';
import './Testimonials.css';

import avatar1 from '../../assets/images/Fotos profesionales/2.png';
import avatar2 from '../../assets/images/Fotos profesionales/3.png';
import avatar3 from '../../assets/images/Fotos profesionales/4.png';
import avatar4 from '../../assets/images/Fotos profesionales/5.png';
import avatar5 from '../../assets/images/Fotos profesionales/6.png';
import bulbIcon from '../../assets/images/Iconos/Recurso 40.png';
import decor1 from '../../assets/images/Iconos/Recurso 67.png';
import decor2 from '../../assets/images/Iconos/Recurso 68.png';

const testimonialsLeft = [
  {
    avatar: avatar1,
    title: 'Adriana Navas',
    subtitle: 'Profesional independiente',
    text:
      'De sus talleres me gusta la coherencia. Aprendes lo que realmente funciona y lo ves aplicado en tiempo real.',
    rotate: -2.5,
  },
  {
    avatar: avatar2,
    title: 'Elena Paula',
    subtitle: 'Yasmin Ruiz · Fundadora de Sembrando huellas Venezuela',
    text:
      'Gracias por ser tan espléndida al compartir tu experticia. El país necesita profesionales como tú que buscan la excelencia.',
    rotate: 6,
  },
];

const testimonialsRight = [
  {
    avatar: avatar3,
    title: 'Orianny Alonzo — Emprendedora',
    subtitle: '',
    text:
      'Me mostró herramientas y estrategias para definir mi modelo de negocio, propuesta de valor y contenido. Fue muy claro y útil.',
    rotate: -3,
  },
  {
    avatar: avatar4,
    title: 'Ángel Nieves — Marca personal',
    subtitle: '',
    text:
      'Ahora tengo claridad total sobre mi ecosistema de valor. Salí con un plan claro para avanzar sin invertir a ciegas.',
    rotate: 7,
  },
];

const centerBranding = {
  avatar: avatar5,
  title: 'Andreína y Mariana — Cruzando Fronteras (podcast)',
  text:
    'El servicio superó nuestras expectativas. Recibimos acompañamiento, consejos y guía en cada paso. Quedamos súper contentas.',
};

const Testimonials = () => {
  return (
    <section id="testimonios" className="testimonials-section">
      {/* Imágenes decorativas */}
      <img src={decor1} alt="" className="t-decor t-decor--top-left" />
      <img src={decor2} alt="" className="t-decor t-decor--top-right" />
      <img src={decor1} alt="" className="t-decor t-decor--bottom-left" style={{ transform: 'rotate(45deg)' }} />
      <img src={decor2} alt="" className="t-decor t-decor--bottom-right" />
      
      {/* Bombillo */}
      <img src={bulbIcon} alt="" className="t-bulb" />

      <div className="t-container">
        <div className="t-header">
          <h2 className="t-title">Testimonios <span className="t-script">reales</span></h2>
        </div>

        <div className="t-grid">
          {/* Columna izquierda */}
          <div className="t-col">
            <div className="t-pill t-pill--yellow rotate-3">Taller</div>
            {testimonialsLeft.map((t, idx) => (
              <div
                key={`l-${idx}`}
                className="t-card"
                style={{ transform: `rotate(${t.rotate}deg)` }}
              >
                <div className="t-card-head">
                  <img src={t.avatar} alt="avatar" className="t-avatar" />
                  <div>
                    <div className="t-name">{t.title}</div>
                    {t.subtitle && <div className="t-sub">{t.subtitle}</div>}
                  </div>
                </div>
                <p className="t-text">"{t.text}".</p>
              </div>
            ))}
          </div>

          {/* Centro branding */}
          <div className="t-center">
            <div className="t-pill t-pill--purple">Branding</div>
            <div className="t-card t-card--center">
              <div className="t-card-head">
                <img src={centerBranding.avatar} alt="avatar" className="t-avatar" />
                <div>
                  <div className="t-name">{centerBranding.title}</div>
                </div>
              </div>
              <p className="t-text">"{centerBranding.text}".</p>
            </div>
          </div>

          {/* Columna derecha */}
          <div className="t-col t-col--right">
            <div className="t-pill t-pill--yellow rotate-6 t-pill-right">Asesorías</div>
            {testimonialsRight.map((t, idx) => (
              <div
                key={`r-${idx}`}
                className="t-card"
                style={{ transform: `rotate(${t.rotate}deg)` }}
              >
                <div className="t-card-head">
                  <img src={t.avatar} alt="avatar" className="t-avatar" />
                  <div>
                    <div className="t-name">{t.title}</div>
                    {t.subtitle && <div className="t-sub">{t.subtitle}</div>}
                  </div>
                </div>
                <p className="t-text">"{t.text}".</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Testimonials;
